import React from 'react'
import NavBar from './components/NavBar/NavBar'
import Schedule from './components/Schedule/Schedule'
import {
  Switch,
  Route,
} from "react-router-dom";

function App() {
  return (
    <div>
      <NavBar>
        <Switch>
          <Route path="/schedule">
            <Schedule />
          </Route>
        </Switch>
      </NavBar>
    </div>
  );
}

export default App;
